import React, { Component } from 'react'

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      time: 0,
    }
  }

  componentDidMount() {
    setInterval(() => {
      this.setState(({ time }) => ({time: time + 1}))
    }, 1000)
  }

  render() {
    const { time } = this.state;
    return (
      <h1>
        {
          time
        }
      </h1>
    )
  }
}
